import React from 'react'

const magicList = (props)=>{

	const cardsList = props.magicCards.map((magicCards, i)=>{
		return <li key={i} className="three wide column" className="ui image medium">{magicCards.name}, ({magicCards.set}), {magicCards.rarity}<img src={magicCards.image_uris.large} alt='magic cards' className='enlarge'/></li>
	})
	return(
		<ul className = "ui grid">
			{cardsList}
		</ul>
	)
}

export default magicList
